import React, {useEffect} from 'react';

import Charger from '../components/Charger.js'
import { fetchActiveSession } from "../services/charger/fetchSessionService";
import {fetchChargers} from "../services/charger/fetchChargersService";
import {doPostAsync} from "../services/http/http";

/**
 * @author Magnus
 * Komponenten er siden med Charger-komponent.
 *
 * @component
 */

function ChargerPage({ match }) {

    useEffect(() => {
        fetchActiveSession().then(x => {
            console.log(x);
        }).catch((error) => {
            console.log(error);
    });
    }, []);

    return (
        <div className="scopeContent">
            <Charger chargerId={match.params.id}
                     name="Gutta ladærn"
                     owner="Sven Sørensen"
                     interval={8}/>
        </div>
    );
}

export default ChargerPage;
